import React from "react";
import { useSelector } from "react-redux";

function Tipos(){

    const types = useSelector((state)=> state.types)

   return(
    <div>
        {
            types.length?.map(e=>{
                return <p>{e.name}</p>
            })
        }
    </div>
   )
}

export default Tipos;
